export const Logo: React.FC<LogoProps> = ({ 
  size = 'medium', 
  variant = 'icon-only',
  className = '',
  onClick
}) => {
  const sizes = {
    small: 60,
    medium: 120,
    large: 180,
    full: 240,
  };

  const pixelSize = sizes[size];

  const handleClick = onClick ? { onClick, style: { cursor: 'pointer' } } : {};

  // Icon Only Version (for app icon, favicon)
  if (variant === 'icon-only') {
    return (
      <div
        className={className}
        {...handleClick}
      >
        <LogoSVG size={pixelSize} />
      </div>
    );
  }

  // Horizontal Logo (for headers) - Logo + Text
  if (variant === 'horizontal') {
    return (
      <div 
        className={`flex items-center gap-2 ${className}`}
        {...handleClick}
      >
        <LogoSVG size={pixelSize * 0.6} />
        <span 
          className="text-2xl font-bold whitespace-nowrap"
          style={{ 
            fontSize: size === 'small' ? '16px' : size === 'medium' ? '20px' : '28px' 
          }}
        >
          <span style={{ color: '#2563EB' }}>Inter</span>
          <span style={{ color: '#10B981' }}>vuu</span>
        </span>
      </div>
    );
  }

  // Full Logo (default) - Logo + Text below
  return (
    <div 
      className={`flex flex-col items-center gap-0 ${className}`}
      {...handleClick}
    >
      <LogoSVG size={pixelSize * 0.75} />
      <span 
        className="text-2xl font-bold"
        style={{ 
          fontSize: size === 'small' ? '14px' : size === 'medium' ? '20px' : size === 'large' ? '24px' : '32px' 
        }}
      >
        <span style={{ color: '#2563EB' }}>Inter</span>
        <span style={{ color: '#10B981' }}>vuu</span>
      </span>
    </div>
  );
};

export default Logo;
